.hud-advice-wrap {
  // .fl-col-aie;
  width: @328px;
  color: white;
  position: absolute;
  left: 0;
  // bottom: 237px;
}

.hud-advice-item {
  padding: @27px;
  min-height: @90px;
  width: 100%;
  position: relative;
  .fl-row-aic-jcs;
  background: rgba(20, 27, 31, 0.7);
  margin-bottom: @4px;
  .br6;

  &:last-of-type {
    margin-bottom: 0;
  }

  &:after {
    content: '';
    display: block;
    height: 100%;
    width: @5px;
    border-radius: 0 @4px @4px 0;
    position: absolute;
    left: 0;
    top: 0;
  }

  &.success {

    &:after {
      background-color: @green;
    }

    .img-wrap {
      background-color: @green;
    }
  }

  &.error {

    &:after {
      background-color: @yellow2;
    }

    .img-wrap {
      background-color: @yellow2;
    }
  }

  &.warning {

    &:after {
      background-color: @orange;
    }

    .img-wrap {
      background-color: @orange;
    }
  }

  &.info {

    &:after {
      background-color: @lightblue;
    }

    .img-wrap {
      background-color: @lightblue;
    }
  }

  .img-wrap {
    width: @32px;
    height: @32px;
    overflow: hidden;
    z-index: 10;
    position: relative;
    margin-right: @8px;
    .br6;
  }

  .text-wrap {
    //			width: @240px;
    width: 80%;
    position: relative;
    z-index: 10;

    .p-title {
      font-weight: normal;
      font-size: @16px;
      text-shadow: 0px @1px @10px rgba(0, 0, 0, 0.4);
      margin-bottom: @7px;
      line-height: 140%;
    }

    .p-descr {
      font-weight: 500;
      font-size: @14px;
      color: rgba(255, 255, 255, 0.4);
      text-shadow: 0px @1px @10px rgba(0, 0, 0, 0.6);
    }
  }

  .circle-wrap {
    position: absolute;
    top: @8px;
    right: @8px;
    width: @12px;
    height: @12px;
    z-index: 10;

    & > div {
      position: absolute;
      width: @12px;
      height: @12px;
      .centercenter;
    }
  }

  &.v2 {

    .img-wrap {
      margin-right: @8px;
    }

    .button-wrap {
      .fl-row-aic-jcs;
      position: relative;
      z-index: 10;
      margin-right: @18px;

      button {
        width: @32px;
        height: @32px;
        margin-right: @8px;

        &:last-of-type {
          margin-right: 0;
        }

        img {
          width: @22px;
          height: @22px;
        }
      }
    }

    .text-wrap {
      width: @197px;

      .p-title {
        margin-bottom: 0;
      }
    }
  }
}

section.hud {
  color: white;

  .bg-radial-top-left-hud {
    position: absolute;
    top: 0;
    left: 0;
    background: radial-gradient(100% 100% at 100% 100%, rgba(6, 10, 16, 0.5) 0%, rgba(6, 10, 16, 0) 100%);
    width: @639px;
    height: @454px;
    transform: rotate(-180deg);
  }

  .bg-radial-top-right-hud {
    position: absolute;
    top: 0;
    right: 0;
    background: radial-gradient(100% 100% at 100% 100%, rgba(6, 10, 16, 0.5) 0%, rgba(6, 10, 16, 0) 100%);
    width: @452px;
    height: @338px;
    transform: matrix(1, 0, 0, -1, 0, 0);
  }

  .bg-radial-bottom-right-hud {
    position: absolute;
    bottom: 0;
    right: 0;
    background: radial-gradient(100% 100% at 100% 100%, rgba(6, 10, 16, 0.5) 0%, rgba(6, 10, 16, 0) 100%);
    width: @452px;
    height: @338px;
  }

  .hud-top-left {
    position: absolute;
    transform-origin: left top;
  }

  .hud-chat {
    width: @590px;
    margin-top: @20px;
    margin-left: @20px;

    .hud-chat-history-wrap {
      //			height: @324px;
      height: 30vh;
      overflow: auto;
      margin-bottom: @12px;

      &::-webkit-scrollbar {
        display: none;
      }

      .hud-chat-history-item {
        .fl-row-ais;
        margin-bottom: @6px;

        &:last-of-type {
          margin-bottom: 0;
        }

        p {
          font-weight: 500;
          font-size: @16px;

          &.message {
            line-height: 1.2;
          }

          &.time {
            white-space: nowrap;
          }

          &.name {
            white-space: nowrap;
            margin-left: @4px;
            margin-right: @4px;
          }
        }
      }
    }

    .hud-write-message {
      width: @500px;
      .fl-row-aic-jsb;
      background: rgba(255, 255, 255, 0.2);
      border: @1px solid rgba(255, 255, 255, 0.4);
      height: @48px;
      .br4;

      input {
        border: 0;
        width: 100%;
        height: 100%;
        padding-left: @20px;
        padding-right: @10px;
        color: #fff;
        font-size: @16px;
        font-weight: 500;
        background-color: transparent;

        &::placeholder {
          font-size: @16px;
          font-weight: 500;
          color: rgba(255, 255, 255, .5);
        }
      }

      button {
        width: @48px;
        height: @48px;
        opacity: .5;
        font-size: 0;

        img {
          width: @24px;
          height: @24px;
          pointer-events: none;
          user-select: none;
          transform-origin: left bottom;
          .anim;
        }

        &:hover {
          opacity: 1;

          img {
            transform: translateX(2px);
          }
        }
      }
    }

    .hud-extra-radiobutton-item {

      input {
        display: none;

      }

      label {
        font-weight: 500;
        font-size: @14px;
      }
    }
  }

  .hud-extra-radiobutton-wrap {
    .fl-row-aic-jcs;
    margin-top: @6px;

    .hud-extra-radiobutton-item {
      margin-right: @16px;

      &:last-of-type {
        margin-right: 0;
      }

      input {
        display: none;
        opacity: 0;
        text-indent: -3000em;

        &:checked + label {
          color: rgba(255, 255, 255, 1);
          text-shadow: 0px @1px @10px rgba(0, 0, 0, 0.6);

          &:hover {
            color: rgba(255, 255, 255, 1);
          }
        }

        &:not(checked) + label {
          color: rgba(255, 255, 255, 0.4);
          text-shadow: 0px @1px @10px rgba(0, 0, 0, 0.6);

          &:hover {
            color: rgba(255, 255, 255, 0.6);
          }
        }
      }

      label {
        .anim;
        cursor: pointer;
      }
    }
  }


  .hud-money-candy {
    margin-bottom: @10px;
    display: flex;
    align-items: center;
    border-radius: @100px;
    background-color: #ffffff1a;
    height: @30px;
    padding: 0 @7px;
    box-sizing: border-box;

    img {
      width: @18px;
      margin-right: @7px;
    }

    span {
      font-size: @15px;
    }
  }

  .hud-money-wrapper {
    position: relative;
    display: flex;
    flex-direction: column;

    .money-wrap {
      margin-right: @6px;

      .p-big {
        font-weight: bold;
        font-size: @24px;
        text-shadow: 0px @4px @100px #22285F;
        margin-bottom: @6px;
        text-shadow: 0px 4px 13px rgba(0, 0, 0, 0.6);
      }

      .p-small {
        font-weight: 400;
        font-size: @16px;
        color: rgba(255, 255, 255, 1);
        text-shadow: 0px 4px 13px rgba(0, 0, 0, 0.6);
      }
    }
  }

  .hud-location-wrapper {
    .fl-col-ais;
    position: absolute;
    bottom: @18px;
    left: 320px;
    transform-origin: left bottom;

    .hud-money-wrapper {
      .fl-row-ais;

      .hud-raised-money {
        margin-right: auto;
        .fl-row-ais;
        padding: @5px;
        .br4;
        background: rgba(20, 27, 31, 0.8);

        p {
          margin: 0;
          font-size: @14px;
          text-shadow: 0px 4px 13px rgba(0, 0, 0, 0.6);
        }

        img {
          width: @14px;
          height: @7px;
          pointer-events: none;
          user-select: none;
          margin-left: @4px;
          font-size: 0;
        }
      }
    }

    .text-wrap {
      position: relative;
      height: 100%;

      & > div:first-child {
        margin-top: @8px;
      }

      .location-area {
        .fl-row-aic-jcs;
        padding: @12px;
        background: linear-gradient(90deg, rgba(20, 27, 31, 0.7) 0%, rgba(20, 27, 31, 0) 100%);
        .br6;

        &.green-area {
          p {
            &.p-green {
              display: block;

              span {
                color: @green;
              }
            }
          }

          .icon-wrap {
            &.green-area-icon {
              display: block;

              img {
                position: relative;
                z-index: 10;
              }
            }
          }
        }

        &.red-area {
          p {
            &.p-red {
              display: block;

              span {
                color: @red;
              }
            }
          }

          .icon-wrap {
            &.red-area-icon {
              display: block;

              img {
                position: relative;
                z-index: 10;
              }
            }
          }
        }

        p {
          display: none;
          font-size: @16px;
          color: #F2F2F2;
          line-height: .8;
          .upper;

          span {
            font-weight: 800;
          }
        }

        .icon-wrap {
          width: @30px;
          height: @30px;
          display: none;

          img {
            width: 100%;
            height: 100%;
            z-index: 10;
            font-size: 0;
            pointer-events: none;
            user-select: none;
          }

          &.active {
            display: block;

            img {
              position: relative;
              z-index: 10;
            }
          }
        }
      }

      .downline {
        .fl-row-aic-jcs;
        margin-top: @8px;

        & > div:first-child {
          margin-right: @8px;
        }

        & > div:last-child {
          margin-right: 0;
        }
      }

      .mic-wrap {
        .fl-row-aic-jcc;
        width: @48px;
        height: @50px;
        background: rgba(20, 27, 31, 0.6);
        .br6;

        .icon-wrap {
          display: none;
          width: @24px;
          height: @24px;

          img {
            width: 100%;
            height: 100%;
            pointer-events: none;
            user-select: none;
          }
        }

        &.on {
          .mic-on {
            display: block;
          }
        }

        &.off {
          .mic-off {
            display: block;
          }
        }
      }

      .address-wrap {
        .fl-row-aic-jcs;
        .br6;
        padding: @12px;
        height: @50px;
        background: linear-gradient(90deg, rgba(20, 27, 31, 0.7) 0%, rgba(20, 27, 31, 0) 100%);

        img {
          width: @24px;
          height: @24px;
          pointer-events: none;
          user-select: none;
          margin-right: @8px;
        }

        .p-big {
          margin: 0;
          font-weight: 800;
          font-size: @14px;
          margin-bottom: @4px;
        }

        .p-descr {
          margin: 0;
          color: #F2F2F2;
          font-weight: 400;
          font-size: @14px;
        }
      }
    }
  }


